.accordion__panel {

Ramadas/Documents/Git_repo/ignition-qa/AFS_Automation/OMS_Automation/src/test/resources/features_DSD_OMS/QuoteFeature/quoteFeature1.feature","data":"Feature: Quotes1\r\n  Used for cration of Quotes and test different functionality\r\n\r\n  Background: For login to application and selecting Account#\r\n    Given User enters URL and is on login page and entered credentials for Quotes\r\n    When User is on Home Page for Quotes\r\n    Then User navigate to Client side for Quotes\r\n    Then User should select Order Entry tab for Quotes\r\n    Then User selects Account# for Quotes\r\n\r\n  @DeleteProductQuote\r\n  Scenario Outline: Test scenario to create Quote with multiple products and delete one of the product from quote\r\n    Given User must be on Order Entry Page\r\n    And User clicks on drop down next to Start order button and select Quote option\r\n    Then User enters Quote name \"\u003cQuoteName\u003e\" and Quote End date click on OK button\r\n    Then User should find select Order guide from popup\r\n    Then User should select Note from popup\r\n    Then Enter multiple Pro# in Quick Product Entry area in New Qutoe page and enter Qty for Case and Unit\r\n      |40|40|\r\n      |20|10|\r\n      |40|50|\r\n    And User selects one product from product grid and click on delete button\r\n    Then Click on create button in New Quote page\r\n    And User click on Back to orderlist button from Quote summary page and Read order number\r\n    Then Verify User is on Order Entry Page and verify Quote is existing\r\n    Examples:\r\n      |QuoteName|\r\n      | Quote123|\r\n\r\n  @EditQuote\r\n  Scenario Outline: Test scenario to edit Quote by adding Product from Quick product entry\r\n    Given User must be on Order Entry Page\r\n    And User clicks on drop down next to Start order button and select Quote option\r\n    Then User enters Quote name \"\u003cQuoteName\u003e\" and Quote End date click on OK button\r\n    Then User should find select Order guide from popup\r\n    Then User should select Note from popup\r\n    Then Enter Pro# in Quick Product Entry area in New Qutoe page and enter Qty for Case and Unit\r\n      |40|40|\r\n    Then Click on create button in New Quote page\r\n    And User click on Back to orderlist button from Quote summary page and Read order number\r\n    Then Verify User is on Order Entry Page and verify Quote is existing\r\n    Then User selects Quote in Order Entry grid\r\n    And User should be navigated to Quote summary page and click on Edit button\r\n    Then If user navigates to payment and address page click on Back button or else add product# in Quick product entry\r\n      |20|15|\r\n    Then Click on create button in New Quote page\r\n    And User click on Back to orderlist button from Quote summary page and Read order number\r\n    Then Verify User is on Order Entry Page and verify Quote is existing\r\n    Examples:\r\n      |QuoteName|\r\n      | Quote123|\r\n\r\n  @EditQuoteOG\r\n  Scenario Outline: Test scenario for editing quote by adding OG to quote\r\n    Given User must be on Order Entry Page\r\n    And User clicks on drop down next to Start order button and select Quote option\r\n    Then User enters Quote name \"\u003cQuoteName\u003e\" and Quote End date click on OK button\r\n    Then User should find select Order guide from popup\r\n    Then User should select Note from popup\r\n    Then Enter Pro# in Quick Product Entry area in New Qutoe page and enter Qty for Case and Unit\r\n      |40|40|\r\n    Then Click on create button in New Quote page\r\n    And User click on Back to orderlist button from Quote summary page and Read order number\r\n    Then Verify User is on Order Entry Page and verify Quote is existing\r\n    Then User selects Quote in Order Entry grid\r\n    And User should be navigated to Quote summary page and click on Edit button\r\n    Then If user navigates to payment and address page click on Back button or else Click on Add product and select OG \"\u003cOG\u003e\"\r\n      |20|15|\r\n    Then Click on create button in New Quote page\r\n    And User click on Back to orderlist button from Quote summary page and Read order number\r\n    Then Verify User is on Order Entry Page and verify Quote is existing\r\n    Examples:\r\n      |QuoteName|    OG   |\r\n      | Quote123| SampleOG|\r\n\r\n  @CancelWhileEditing\r\n  Scenario Outline: test scenario for cancelling quote at the time of edit quote\r\n    Given User must be on Order Entry Page\r\n    And User clicks on drop down next to Start order button and select Quote option\r\n    Then User enters Quote name \"\u003cQuoteName\u003e\" and Quote End date click on OK button\r\n    Then User should find select Order guide from popup\r\n    Then User should select Note from popup\r\n    Then Enter Pro# in Quick Product Entry area in New Qutoe page and enter Qty for Case and Unit\r\n      |40|40|\r\n    Then Click on create button in New Quote page\r\n    And User click on Back to orderlist button from Quote summary page and Read order number\r\n    Then Verify User is on Order Entry Page and verify Quote is existing\r\n    Then User selects Quote in Order Entry grid\r\n    And User should be navigated to Quote summary page and click on Edit button\r\n    Then If user navigates to payment and address page click on Back button or else add product# in Quick product entry\r\n      |20|15|\r\n    Then Click on Cancel button in New Quote page\r\n    Examples:\r\n      |QuoteName|\r\n      | Quote123|\r\n\r\n  @CommentInQuote\r\n  Scenario Outline: Test scenario for adding comment to quote\r\n    Given User must be on Order Entry Page\r\n    And User clicks on drop down next to Start order button and select Quote option\r\n    Then User enters Quote name \"\u003cQuoteName\u003e\" and Quote End date click on OK button\r\n    Then User should find select Order guide from popup\r\n    Then User should select Note from popup\r\n    Then Enter Pro# in Quick Product Entry area in New Qutoe page and enter Qty for Case and Unit\r\n      |40|40|\r\n    And User click on Comment Icon in Quote page and select Internal comment flag\r\n      |Adding Comment in Quote|\r\n    Then Click on create button in New Quote page\r\n    And User click on Back to orderlist button from Quote summary page and Read order number\r\n    Then Verify User is on Order Entry Page and verify Quote is existing\r\n    Examples:\r\n      |QuoteName|\r\n      | Quote123|\r\n\r\n  @NavigateQuoteSummay\r\n  Scenario Outline: Test scenario for navigating from OE page to Quote summary page\r\n    Given User must be on Order Entry Page\r\n    And User clicks on drop down next to Start order button and select Quote option\r\n    Then User enters Quote name \"\u003cQuoteName\u003e\" and Quote End date click on OK button\r\n    Then User should find select Order guide from popup\r\n    Then User should select Note from popup\r\n    Then Enter Pro# in Quick Product Entry area in New Qutoe page and enter Qty for Case and Unit\r\n      |40|40|\r\n    Then Click on create button in New Quote page\r\n    And User click on Back to orderlist button from Quote summary page and Read order number\r\n    Then Verify User is on Order Entry Page and verify Quote is existing\r\n    Then User selects Quote in Order Entry grid\r\n    And User should be navigated to Quote summary page\r\n    Examples:\r\n      |QuoteName|\r\n      | Quote123|\r\n\r\n  @DeleteCancel\r\n  Scenario Outline: Test scenario for deleting or canceling Quote\r\n    Given User must be on Order Entry Page\r\n    And User clicks on drop down next to Start order button and select Quote option\r\n    Then User enters Quote name \"\u003cQuoteName\u003e\" and Quote End date click on OK button\r\n    Then User should find select Order guide from popup\r\n    Then User should select Note from popup\r\n    Then Enter Pro# in Quick Product Entry area in New Qutoe page and enter Qty for Case and Unit\r\n      |40|40|\r\n    Then Click on create button in New Quote page\r\n    And User click on Back to orderlist button from Quote summary page and Read order number\r\n    Then Verify User is on Order Entry Page and verify Quote is existing\r\n    Then User selects Quote in Order Entry grid\r\n    And User should be navigated to Quote summary page and click on cancel button\r\n    Examples:\r\n      |QuoteName|\r\n      | Quote123|\r\n\r\n    @SkipQuoteFromOE\r\n    Scenario: Test scenario to verify skip in Quote\r\n      Given User must be on Order Entry Page\r\n      Then Change the date 4 days after current date\r\n      And User verifies skip button in OE page when Quotes is already create\r\n\r\n    @SkipQuoteInNewOE\r\n    Scenario: Test scenario to verify skip in New OE page, when Quote is already existing\r\n      Given User must be on Order Entry Page\r\n      Then Change the date 4 days after current date\r\n      Then User must click Start Order button\r\n      Then User should make selection between Pending order or Start New order\r\n      Then User should select Note from popup and Order guide from popup\r\n      And User verifies Skip button in New OE page\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Divya.Ramadas/Documents/Git_repo/ignition-qa/AFS_Automation/OMS_Automation/src/test/resources/features_DSD_OMS/QuoteFeature/quoteFeature1.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Quotes1","description":"  Used for cration of Quotes and test different functionality","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"For login to application and selecting Account#","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","text":"User enters URL and is on login page and entered credentials for Quotes","id":"be9fa8e3-1636-4475-8d23-8b9621343301"},{"location":{"line":6,"column":5},"keyword":"When ","text":"User is on Home Page for Quotes","id":"450a1dbc-e4 window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"15.0.0","implementation":{"name":"cucumber-jvm","version":"6.11.0"},"runtime":{"name":"Java HotSpot(TM) 64-Bit Server VM","version":"16+36-2231"},"os":{"name":"Windows 10"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":"1689949811","nanos":150725900}}},{"source":{"uri":"file:///C:/Users/Sneha.Pallikunnath/ignition-qa/AFS_Automation/OMS_Automation/src/test/resources/features_Shared/features_Shared_DSD/BadgeBuilderFeature/iconsSelectionFeature.feature","data":"Feature: Badge Builder Icon Selection\r\n  Background: For login to application and to select Badge Builder\r\n    Given User enters URL and entered to login page\r\n\r\n#\r\n  @IconSelection\r\n  Scenario: Test Scenario for Selecting Icon from Badge Builder\r\n    Given  User on login page and entered username and password\r\n    When   Navigated to Admin home page\r\n    Then   Click on General Setting tab\r\n    And    Clicks on Badge Builder\r\n    And    Select Icon under icon selections\r\n  @BadgeName\r\n  Scenario: Test Scenario for Editing Badge Name\r\n    Given  User should be on BadgeBuilder page\r\n    When   Select Icon under icon selection\r\n    And    Edit Badge name under Badge Info\r\n    Then   Verify updated Badge name\r\n\r\n  @BadgeCode\r\n  Scenario: Test Scenario to verify Badge Code field\r\n    Given  User should be on BadgeBuilder page\r\n    When   Select Icon under icon selection\r\n    Then   Verify Badge Code field\r\n\r\n  @Save\u0026AddToGallery\r\n  Scenario: Test Scenario to verify Save\u0026AddToGallery\r\n    Given  User should be on BadgeBuilder page\r\n    When   Select Icon under icon selection\r\n    And    Change Badge name field under Badge Info\r\n    And    Change Icon Color\r\n    And    Clicks on Save and add to gallery button\r\n    Then   Verify Saved Icon Changes\r\n\r\n  @BadgeType\r\n  Scenario: Test Scenario for Changing BadgeType\r\n    Given  User must be on BadgeBuilder page\r\n    Then   Change BadgeType and verify changes\r\n\r\n  @DeleteAction\r\n  Scenario: Test Scenario for Deleting Icon from Badge Builder\r\n    Given  User must be on BadgeBuilder page\r\n    When   User should navigate to Badge Gallery\r\n    And    Click on any Badge under Badge Gallery\r\n    Then   Verify delete button\r\n\r\n  @EditAction\r\n  Scenario: Test Scenario for Editing Icon from Badge Builder\r\n    Given  User must be on BadgeBuilder page\r\n    When   User should navigate to Badge Gallery\r\n    And    Click on any Badge under Badge Gallery1\r\n    And    Click on the Edit button\r\n    And    Change Badge info, Icon color and Badge type\r\n    And    Clicks on the Save and add to gallery button\r\n    Then   Verify Saved Icon Change\r\n#\r\n  @VerifyColorChangeInOE-TieredPricingProducts\r\n  Scenario: Test Scenario to Verify Icon Color Change In OrderEntry -  TieredPricingProducts\r\n    Given  User must be on BadgeBuilder page\r\n    When   Click Permission By and select appropriate Company\r\n    And    User should navigate to Badge Gallery - TieredPricingProduct\r\n    And    Change Color of the TieredPricingProduct Icon\r\n    And    User should navigate to Badge Gallery - CatchWeightItems\r\n    And    Change Color of the CatchWeightItems Icon\r\n    And    Logout from Admin portal\r\n    And    Login to Client portal\r\n    Then   User should navigate to Client side\r\n    And    Click on the Order Entry tab\r\n    And    Select Account and start Order\r\n    Then   Compare TieredPricingProduct Icon Color\r\n#\r\n#  @VerifyColorChangeInOE-CatchWeightItems\r\n#  Scenario: Test Scenario to Verify Icon Color Change In OrderEntry -  CatchWeightItems\r\n#\r\n#    Given  User on login page and entered username and password\r\n#    When   Navigated to Admin home page\r\n#    Then   Click on General Setting tab\r\n#    And    Clicks on Badge Builder\r\n#\r\n#    Given  User must be on BadgeBuilder page\r\n#    When   Click Permission By and select appropriate Company\r\n#    And    User should navigate to Badge Gallery - CatchWeightItems\r\n#    And    Change Color of the CatchWeightItems Icon\r\n#    And    Logout from Admin portal\r\n#    And    Login to Client portal\r\n#    Then   User should navigate to Client side\r\n#    And    Click on the Order Entry tab\r\n#    And    Select Account and start Order - CatchWeightItems\r\n#    Then   Compare CatchWeightItems Icon Color\r\n\r\n  @VerifyColorChangeInCatalogTab-CatchWeightItems\r\n  Scenario: Test Scenario to Verify Icon Color Change In Catalog -  CatchWeightItems\r\n    Given  user must be on Order Entry Page\r\n    Then   user should navigate to Catalog tab\r\n    And   Search for Catchweight Item\r\n    Then  Compare Catlog CatchWeightItems Icon Color\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Sneha.Pallikunnath/ignition-qa/AFS_Automation/OMS_Automation/src/test/resources/features_Shared/features_Shared_DSD/BadgeBuilderFeature/iconsSelectionFeature.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Badge Builder Icon Selection","children":[{"background":{"location":{"line":2,"column":3},"keyword":"Background","name":"For login to application and to select Badge Builder","steps":[{"location":{"line":3,"column":5},"keyword":"Given ","text":"User enters URL and entered to login page","id":"dda41e73-24b0-45b7-ac6d-4c634e6b5890"}],"id":"322e7d4a-07ef-4cd1-9b84-8af7c73ced83"}},{"scenario":{"location":{"line":7,"column":3},"tags":[{"location":{"line":6,"column":3},"name":"@IconSelection","id":"79de3891-7d27-4dbc-b8ef-3f3b5904e52d"}],"keyword":"Scenario","name":"Test Scenario for Selecting Icon from Badge Builder","steps":[{"location":{"line":8,"column":5},"keyword":"Given ","text":"User on login page and entered username and password","id":"f6984242-9244-44f9-b67f-1a53d1e2bfbb"},{"location":{"line":9,"column":5},"keyword":"When
